import React, { useState } from 'react';
import axios from 'axios';

const CreateMeeting = () => {
  const [meetingLink, setMeetingLink] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleCreateMeeting = async () => {
    setLoading(true);
    setError('');
    
    try {
      const response = await axios.get('http://localhost:5003/auth/create-meeting', { withCredentials: true });
      
      if (response.data.success) {
        setMeetingLink(response.data.meetingLink);
      } else {
        setError('Failed to create meeting');
      }
    } catch (err) {
      console.error(err);
      setError('An error occurred while creating the meeting.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h1>Create a New Meeting</h1>
      <button onClick={handleCreateMeeting} disabled={loading}>
        {loading ? 'Creating Meeting...' : 'Create Meeting'}
      </button>

      {error && <p style={{ color: 'red' }}>{error}</p>}
      {meetingLink && (
        <div>
          <h3>Meeting Created Successfully</h3>
          <p>Your meeting link: <a href={meetingLink} target="_blank" rel="noopener noreferrer">{meetingLink}</a></p>
        </div>
      )}
    </div>
  );
};

export default CreateMeeting;
